import React, { Component } from 'react'

export class Features extends Component {
    render() {
        return (
            <div>
                <img
                src="https://mdbootstrap.com/img/new/standard/city/047.jpg"
                class="img-fluid rounded"
                alt=""
                />
            </div>
        )
    }
}

export default Features
